INSERT INTO AUDIO_FILE VALUES('JHS05SideA', '2016-10-13 17:01:23', 'Internet Archive HTML5 Uploader 1.6.3', 'English', '1996-10-29', 'Rosenthal, Minerva', 'Side A: Minerva Bonen/Rosenthal interviewed. Mother Sarah Siet. Was a Trenton High School grad, involved in various community activities. Recalls a Rabbi Mosavich and many other Jewish figures from her youth. Worked as a saleswoman at the Bender''s store, in the sportswear department. Discussion of other Rosenthal family members, too. Side B: Blank.', 'https://ia803200.us.archive.org/8/items/JHS05SideA/JHS%2005-%20side%20A.mp3');
INSERT INTO AUDIO_FILE VALUES('JHS08SideA', '2016-10-13 16:52:36', 'Internet Archive HTML5 Uploader 1.6.3', 'English', ' 1988-06-08', 'Klatzkin, Joe & Ida', 'copy from Clive Klatzkin Side A: Ida Mae Klatzkin interviewed by her grandson (on the mother''s side), who has a humorous demeanor. Born in Philadelphia as Ida Mae Smith. Her husband was her violin teacher''s son. Family came from Lithuania, her father came to the U.S. when he was 19, to Philadelphia. Her parents met later as her mother came to the U.S. later. Father Lewis Smith, mother Devera Esther Aronson. This is a family tape that delves into family history, also talking to Joe Klatzkin. Side B: Continues.', 'https://ia801904.us.archive.org/8/items/JHS08SideA/JHS%2008-%20side%20A.mp3');
INSERT INTO AUDIO_FILE VALUES('JHS10SideA', '2016-10-13 16:46:51', 'Internet Archive HTML5 Uploader 1.6.3', 'English', '2003-10-16', 'Finkle, Herman "Humpsy"', 'Side A: Interviewed at his house. Most of the interview consists of miscellaneous reminiscences of "Jewtown" (the Jewish neighborhood in South Trenton) between the mid-1930s and 1940s. Recalls the YMHA (Young Men''s Hebrew Association) on Stockton Street, and many businesses (including Herman Spiegel Furniture and a drugstore) near the intersection of Market and Lamberton Streets. At the beginning of WW2, worked at the GM Factory in Ewing Township. Later entered the service and visited Palestine before it became the State of Israel. Mentions one Benny (?) Olinsky as the "keeper of Jewish history in Trenton." Side B: Blank.', 'https://ia801207.us.archive.org/3/items/JHS10SideA/JHS%2010-%20side%20A.mp3');
